      description: The access level on the link for this file.
    - id: audienceRestrictingSharedFolder
      type: Dropbox.Api.Sharing.AudienceRestrictingSharedFolder
      description: >-
        The shared folder that prevents the

        link audience for this link from being more restrictive.
    - id: expiry
      type: System.Nullable{System.DateTime}
      description: >-
        Whether the link has an expiry set on it. A link with an

        expiry will have its  audience changed to members when the expiry is

        reached.
